import './resultsWindow.css';
import React from 'react';
import { Component } from 'react';
import { withStyles } from '@mui/material/styles';
import Box from '@mui/material/Box';
import RORCalc from './calcResults.js'

class ResultsWindow extends Component {
  render() {
    return (
      <Box
        sx={{ flexGrow: 1, bgcolor: 'background.paper', display: 'flex'}}
      >
        <div id="resultsWindow" className="modal bd-example-modal-lg">
          <div className="modal-dialog modal-lg">
            <div id="calcResults" className="modal-content">
              <div className="modal-header">
                <div className="loader">
                  <h5 className="calc-heading" id="ModalLabel"> Calculation Results</h5>
                </div>
                  <RORCalc />
              </div>
            </div>
          </div>
        </div>
      </Box>
    )
  }
}

export default ResultsWindow;
